import classes from './Input.module.css'

const Input = (props)=>{
   return( 
     <div className={classes.input} onChange={props.onChange}>
       <label>{props.label}</label>
       <input type={props.type} value={props.val}  min= '1'/>
     </div>
     )
}


export default Input
